('PORTO1608125E2A', 'Sambutan', '<p style="margin: 0px 0px 15px; padding: 0px; text-align: justify; font-family: ''Open Sans'', Arial, sans-serif; font-size: 14px; line-height: 20px;"><strong>Lorem ipsum dolor sit amet,</strong> consectetur adipiscing elit. Morbi sit amet mauris consequat, rutrum erat quis, venenatis massa. Phasellus tempus velit at neque luctus dignissim. Donec laoreet eleifend elit sit amet pulvinar. Quisque ornare turpis justo, eget posuere est tempus at. Duis vitae ultricies nunc, sed maximus lorem. Nam et quam maximus, semper nisl pellentesque, molestie urna. Integer consequat in justo id commodo. Aenean at sagittis quam. Curabitur eros urna, pulvinar id risus quis, aliquet laoreet nibh. Sed quis vulputate velit, non vehicula lorem. Curabitur venenatis, sapien eu congue finibus, lectus nisl ultrices mauris, id tempus ante diam eu nunc. Sed leo arcu, ornare in eleifend nec, placerat vitae erat. Vestibulum libero orci, malesuada vel nibh vel, mattis condimentum ligula. Duis quis leo porttitor, tincidunt leo eu, feugiat nulla.</p>\r\n<p style="margin: 0px 0px 15px; padding: 0px; text-align: justify; font-family: ''Open Sans'', Arial, sans-serif; font-size: 14px; line-height: 20px;">Aliquam sodales tortor pulvinar rhoncus iaculis. Cras non diam ligula. Nullam sed tortor velit. Morbi placerat massa leo, vitae malesuada libero venenatis nec. Vestibulum sit amet risus quis libero egestas gravida in eget orci. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Maecenas dui quam, dignissim id massa et, varius semper libero. Etiam vestibulum elit semper consectetur ullamcorper. Vestibulum sed ullamcorper sem. Ut dui nunc, dapibus ac varius nec, dictum nec ligula. Donec eleifend scelerisque risus, quis pellentesque lectus volutpat sit amet. Nam risus elit, sodales sed dignissim at, egestas pharetra purus. Praesent ornare tincidunt arcu, non elementum ante porta vel. Morbi quis mollis massa. Donec condimentum nisl in posuere iaculis.</p>', '../style/images/Sambutan.jpg', '1'),
('PORTO160815F177', 'Visi & Misi', '<p class="MsoNormal" style="margin: 0in 0in 0.0001pt 14.2pt; text-align: justify;"><strong><span lang="IN" style="font-size: 12.0pt; font-family: ''Arial'',sans-serif;">Visi</span></strong><span lang="IN" style="font-size: 12.0pt; font-family: ''Arial'',sans-serif;"> SDIT Citra Insani adalah &ldquo;Membangun insan yang<em> berilmu, beriman, berkarya dan beramal melalui olah pikir, olah hati, olah gerak dan olah rasa&rdquo;. </em>&nbsp;Misi yang diemban untuk mewujudkan visi sebagaimana disebutkan di atas &nbsp;adalah sebagai berikut;</span></p>\r\n<p class="MsoNormal" style="margin: 0in 0in 0.0001pt 35.45pt; text-align: justify; text-indent: -21.25pt;"><span lang="IN" style="font-size: 12.0pt; font-family: ''Arial'',sans-serif;">(a) Menyelenggarakan pendidikan dasar untuk dapat menguasai ilmu pengetahuan teknologi dan seni;</span></p>\r\n<p class="MsoNormal" style="margin: 0in 0in 0.0001pt 35.45pt; text-align: justify; text-indent: -21.25pt;"><span lang="IN" style="font-size: 12.0pt; font-family: ''Arial'',sans-serif;">(b)&nbsp; Menyelenggarakan pendidikan agama Islam untuk dapat mewujudkan manusia yang lebih beriman, bertaqwa dan berbudi pekerti luhur;</span></p>\r\n<p class="MsoNormal" style="margin: 0in 0in 0.0001pt 35.45pt; text-align: justify; text-indent: -21.25pt;"><span lang="IN" style="font-size: 12.0pt; font-family: ''Arial'',sans-serif;">(c)&nbsp;&nbsp; Menyelenggarakan pendidikan dasar untuk lebih mempertebal kepekaan &nbsp;sosial, nilai-nilai budaya dan karakter bangsa.</span></p>\r\n<p class="MsoNormal" style="margin: 0in 0in 0.0001pt 14.2pt; text-align: justify;"><span lang="IN" style="font-size: 12.0pt; font-family: ''Arial'',sans-serif;">Berdasarkan visi dan misi di atas dirumuskan tujuan pendidikan SDIT Citra Insani &nbsp;sebagai berikut:</span></p>\r\n<p class="MsoNormal" style="margin: 0in 0in 0.0001pt 35.45pt; text-align: justify; text-indent: -21.25pt;"><span lang="IN" style="font-size: 12.0pt; font-family: ''Arial'',sans-serif;">(a)&nbsp; Meletakan dasar kecerdasan, meliputi pengetahuan, sikap dan keterampilan untuk membiasakan hidup mandiri dan mengikuti pendidikan lebih lanjut;</span></p>\r\n<p class="MsoNormal" style="margin: 0in 0in 0.0001pt 35.45pt; text-align: justify; text-indent: -21.25pt;"><span lang="IN" style="font-size: 12.0pt; font-family: ''Arial'',sans-serif;">(b)&nbsp; Meletakan dasar kepribadian, keimanan, ketaqwaan dan akhlak mulia berdasarkan ajaran Islam yang diperlukan untuk hidup mandiri dan mengikuti pendidikan lebih lanjut;</span></p>\r\n<p class="MsoNormal" style="margin: 0in 0in 0.0001pt 35.45pt; text-align: justify; text-indent: -21.25pt;"><span lang="IN" style="font-size: 12.0pt; font-family: ''Arial'',sans-serif;">(c)&nbsp;&nbsp; Meletakan dasar nilai-nilai budaya dan karakter bangsa yang diperlukan untuk menjadi warganegara yang demokratis dan bertanggung jawab. </span></p>\r\n<p><span lang="IN" style="font-size: 12.0pt; line-height: 115%; font-family: ''Arial'',sans-serif; mso-fareast-font-family: ''Times New Roman''; mso-fareast-theme-font: minor-fareast; mso-ansi-language: IN; mso-fareast-language: IN; mso-bidi-language: AR-SA;">Penyelenggaraan pendidikan di SDIT Citra Insani menggunakan sistem maju berkelanjutan atau <em>continous progress system</em> dengan pendekatan belajar tuntas atau <em>mastery learning</em>.</span></p>', '../style/images/Visi & Misi.jpg', '2');
